/*Table structure for table `t_inv_info_pdf` */

DROP TABLE IF EXISTS `t_inv_info_pdf`;

CREATE TABLE `t_inv_info_pdf` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `fpqqlsh` varchar(50) DEFAULT NULL COMMENT '发票请求流水号',
  `orderitemid` varchar(50) DEFAULT NULL COMMENT 'oms订单航信',
  `sale_org` varchar(20) DEFAULT NULL COMMENT '公司代码',
  `store_code` varchar(20) DEFAULT NULL COMMENT '门店代码',
  `ordertime` datetime DEFAULT NULL COMMENT '订单时间',
  `fail_times` int(11) unsigned DEFAULT '0' COMMENT '失败次数',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=utf8;

