/*Table structure for table `t_inv_push` */

DROP TABLE IF EXISTS `t_inv_push`;

CREATE TABLE `t_inv_push` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `fpqqlsh` varchar(50) NOT NULL COMMENT '发票请求唯一流水号',
  `orderitemid` varchar(50) DEFAULT NULL COMMENT 'oms订单行号',
  `posorderid` varchar(16) DEFAULT NULL COMMENT 'pos订单号',
  `b2corderid` varchar(16) DEFAULT NULL,
  `sale_org` varchar(10) DEFAULT NULL COMMENT '销售组织',
  `sale_org_name` varchar(100) DEFAULT NULL COMMENT '公司名称',
  `store_code` varchar(20) DEFAULT NULL COMMENT '门店代码',
  `ordertime` datetime DEFAULT NULL COMMENT '订单时间',
  `kprq` datetime DEFAULT NULL COMMENT '开票日期',
  `fpdm` varchar(12) DEFAULT NULL COMMENT '发票代码',
  `fphm` varchar(8) DEFAULT NULL COMMENT '发票号码',
  `invoice_type` varchar(4) DEFAULT NULL COMMENT '电子发票类型',
  `znxbj` varchar(4) DEFAULT NULL COMMENT '正逆向标记',
  `czdm` varchar(10) DEFAULT NULL COMMENT '操作代码',
  `common_industry_name` varchar(40) DEFAULT NULL COMMENT '通用行业名称',
  `kpjehj` decimal(16,2) DEFAULT NULL COMMENT '开票金额合计',
  `sum_amount_uppercase` varchar(100) DEFAULT NULL COMMENT '开票金额合计大写',
  `tax_sum_amount` decimal(16,2) DEFAULT NULL COMMENT '税额合计',
  `transport_fee` decimal(16,2) DEFAULT NULL COMMENT '运费金额',
  `zkjehj` decimal(16,2) DEFAULT NULL COMMENT '折扣金额合计',
  `hjbhsje` decimal(16,2) DEFAULT NULL COMMENT '合计不含税金额',
  `accepter_invoice_name` varchar(100) DEFAULT NULL COMMENT '收票人名称',
  `taxpayer_no` varchar(50) DEFAULT NULL COMMENT '收票方纳税人识别号',
  `maker_taxpayer_name` varchar(80) DEFAULT NULL COMMENT '开票方纳税人名称',
  `maker_taxpayerno` varchar(20) DEFAULT NULL COMMENT '开票方纳税人识别号',
  `maker_taxpayer_addr` varchar(80) DEFAULT NULL COMMENT '开票人纳税人地址',
  `maker_invoice_bank` varchar(60) DEFAULT NULL COMMENT '开票方开户银行',
  `maker_invoice_account` varchar(50) DEFAULT NULL COMMENT '开票方银行账号',
  `maker_invoice_phone` varchar(30) DEFAULT NULL COMMENT '开票方电话号码',
  `maker_invoice_name` varchar(50) DEFAULT NULL COMMENT '开票人名称',
  `twodimensional_code_info` varchar(1000) DEFAULT NULL COMMENT '二维码信息',
  `print_password` varchar(6) DEFAULT NULL COMMENT '打印密码',
  `pdf_url` varchar(200) DEFAULT NULL COMMENT 'pdf地址',
  `emailinvoice` varchar(50) DEFAULT NULL COMMENT '收票人email',
  `mobphonenum` varchar(30) DEFAULT NULL COMMENT '收票人电话',
  `status` varchar(2) DEFAULT NULL COMMENT '处理状态 5:待发送b2c，6发送b2c失败',
  `operation_code` varchar(10) DEFAULT NULL COMMENT '操作人',
  `operation_date` datetime DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  KEY `idx_fpqqlsh` (`fpqqlsh`),
  KEY `ids_status` (`status`,`sale_org`),
  KEY `idx_ordertime` (`sale_org`,`ordertime`)
) ENGINE=InnoDB AUTO_INCREMENT=2462 DEFAULT CHARSET=utf8 COMMENT='待推送b2c表';

