/*Table structure for table `t_inv_shard_conf` */

DROP TABLE IF EXISTS `t_inv_shard_conf`;

CREATE TABLE `t_inv_shard_conf` (
  `ID` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `SALEORG` varchar(40) DEFAULT NULL COMMENT '销售组织',
  `DATASOURCE_NAME` varchar(40) DEFAULT NULL COMMENT '所属数据源',
  `QYBZ` varchar(4) DEFAULT NULL COMMENT '启用标志',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='分库规则表';

/*Data for the table `t_inv_shard_conf` */

insert  into `t_inv_shard_conf`(`ID`,`SALEORG`,`DATASOURCE_NAME`,`QYBZ`) values (2,'1300','dataSource_inv1','Y'),(3,'2700','dataSource_inv1','Y'),(4,'5016','dataSource_inv1','Y');

/*Table structure for table `t_invoice` */

DROP TABLE IF EXISTS `t_invoice`;

CREATE TABLE `t_invoice` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `fpqqlsh` varchar(50) DEFAULT NULL COMMENT '发票请求唯一流水号',
  `orderitemid` varchar(50) DEFAULT NULL COMMENT 'oms订单行号',
  `posorderid` varchar(20) DEFAULT NULL COMMENT 'pos订单号',
  `b2corderid` varchar(20) DEFAULT NULL COMMENT 'b2c订单号',
  `sap_order_id` varchar(50) DEFAULT NULL COMMENT 'sap销售凭证号',
  `sale_org` varchar(20) DEFAULT '' COMMENT '销售组织代码',
  `sale_org_name` varchar(50) DEFAULT NULL COMMENT '销售组织名称',
  `store_code` varchar(10) DEFAULT NULL COMMENT '门店号',
  `stourename` varchar(50) DEFAULT NULL COMMENT '门店名称',
  `old_orderitemid` varchar(50) DEFAULT NULL COMMENT '原oms行号',
  `old_pos_order_id` varchar(20) DEFAULT NULL COMMENT '原pos单号',
  `old_sale_org` varchar(20) DEFAULT NULL COMMENT '原销售组织',
  `old_store_code` varchar(10) DEFAULT NULL COMMENT '原门店号',
  `ordertime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '订单时间',
  `old_order_time` datetime DEFAULT NULL COMMENT '原销售订单日期',
  `stock_no` varchar(50) DEFAULT NULL COMMENT '出库单号',
  `znxbj` varchar(4) DEFAULT NULL COMMENT '正逆向标记',
  `bfthbs` varchar(4) DEFAULT NULL COMMENT '部分退货标识',
  `thpcs` varchar(4) DEFAULT NULL COMMENT '退货批次',
  `invoices_printlog` varchar(1) DEFAULT NULL COMMENT '发票打印标示',
