/*Table structure for table `t_pre_invoice_item` */

DROP TABLE IF EXISTS `t_pre_invoice_item`;

CREATE TABLE `t_pre_invoice_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `fpqqlsh` varchar(50) NOT NULL COMMENT 'fk',
  `sale_org` varchar(20) DEFAULT NULL COMMENT '销售组织代码',
  `store_code` varchar(10) DEFAULT NULL COMMENT '门店号',
  `ordertime` datetime DEFAULT NULL COMMENT '订单时间',
  `fpdm` varchar(12) DEFAULT NULL COMMENT '发票代码',
  `fphm` varchar(8) DEFAULT NULL COMMENT '发票号码',
  `seqno` varchar(2) DEFAULT NULL COMMENT '行项目序号',
  `cmmdtycode` varchar(18) DEFAULT NULL COMMENT '商品编码',
  `cmmdtyname` varchar(1000) DEFAULT NULL COMMENT '商品名称',
  `jldw` varchar(8) DEFAULT NULL COMMENT '单位',
  `ggxh` varchar(8) DEFAULT NULL COMMENT '规格',
  `sl` decimal(16,2) DEFAULT NULL COMMENT '销售数量',
  `dj` decimal(16,2) DEFAULT NULL COMMENT '单价',
  `je` decimal(16,2) DEFAULT NULL COMMENT '销售金额',
  `ysfy` decimal(16,2) DEFAULT NULL COMMENT '运费',
  `fwfy` decimal(16,2) DEFAULT NULL COMMENT '服务费',
  `yhdzje` decimal(16,2) DEFAULT NULL COMMENT '优惠单总金额',
  `ckjg` decimal(16,2) DEFAULT NULL COMMENT '参考价',
  `tax_rate` decimal(16,2) DEFAULT NULL COMMENT '税率',
  `tax_sum` decimal(16,2) DEFAULT NULL COMMENT '税额',
  `discount_sum` decimal(16,2) DEFAULT NULL COMMENT '折扣金额',
  `price` decimal(16,2) DEFAULT NULL COMMENT '销售价',
  `sap_product_code` varchar(40) DEFAULT NULL COMMENT '商品类目',
  `cmmdty_band` varchar(40) DEFAULT NULL COMMENT '产品层次',
  `phone_code` varchar(200) DEFAULT NULL COMMENT '串码',
  `order_item_type` varchar(4) DEFAULT NULL COMMENT '行项目类别',
  `is_extend_flag` varchar(1) DEFAULT NULL COMMENT '是否为实时延保',
  `extend_type` varchar(20) DEFAULT NULL COMMENT '延保商品类型',
  PRIMARY KEY (`id`),
  KEY `idx_fpqqlsh` (`fpqqlsh`)
